import {NavBar} from "./NavBar";
import {TextBar} from "./TextBar";
import {createTheme} from "@mui/material";


const queryClient = new QueryClient();

const theme = createTheme({
    palette:{
        primary:{
            main: ''
        }

    }
})
function App() {

  return (
      <QueryClientProvider client={queryClient}>
          <div className="App">
              <NavBar/>
              <MessageList/>
              <TextBar/>
          </div>
      </QueryClientProvider>
  );
}

export default App;
